import React, { Component } from 'react';

class DiyList extends Component{
    render(){
        const { category } = this.props;
        const { data } = this.props;
        const list = data.map(
            info => (
                <DiyInfo
                    key={info.id}
                    info={info}
                />)
        );
        return(
            <div>
                <h2>List</h2>
                {
                    (()=> {
                        if (category === 1) return (<div> motor </div>);
                        if (category === 2) return (<div> wings </div>);
                        if (category === 3) return (<div> frame </div>);
                        if (category === 4) return (<div> control board </div>);
                        if (category === 5) return (<div> esc </div>);
                        if (category === 6) return (<div> battery </div>);
                        if (category === 7) return (<div> antenna </div>);
                    })()
                }
            </div>
        );
    }
}

export default DiyList;
